import SearchOptionUI from "../SearchOptionUI";

const date = new Date();

const checkboxTime = [
  { text: "today", value: "day" + date.getDate() },
  { text: "yesterady", value: "day" + date.getDate() - 1 },
  { text: "three days ago", value: "day" + date.getDate() - 3 },
  { text: "a week ago", value: "day" + date.getDate() - 7 },
  { text: "a month ago", value: "month" + date.getMonth() },
  { text: "three months ago", value: "month" + date.getMonth() - 2 },
  { text: "a year ago", value: "year" + date.getFullYear() - 1 },
];

function SearchOptionTime() {
  return (
    <SearchOptionUI dataID="time" label="time" checkboxItem={checkboxTime} />
  );
}

export default SearchOptionTime;
